/*Table structure for table `transferred_items` */

DROP TABLE IF EXISTS `transferred_items`;

CREATE TABLE `transferred_items` (
  `transID` int(100) NOT NULL AUTO_INCREMENT,
  `menuNo` int(100) DEFAULT NULL,
  `itemname` varchar(100) DEFAULT NULL,
  `quantity` int(100) DEFAULT NULL,
  `status` varchar(100) DEFAULT NULL,
  `mDet` varchar(100) DEFAULT NULL,
  `dDet` varchar(100) DEFAULT NULL,
  `yDet` varchar(100) DEFAULT NULL,
  `department` varchar(100) DEFAULT NULL,
  `date` varchar(100) DEFAULT NULL,
  `shift` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`transID`)
